from Type import Type

class Move:
    def __init__(self, name, type, damage, pvp_damage, energy, duration):
        self.name = name
        self.type = type
        self.damage = damage
        self.pvp_damage = pvp_damage
        self.energy = energy
        self.duration = duration

    def __repr__(self):
		    return "Move(name=%r, type=%r, damage=%r, pvp_damage=%r, energy=%r, duration=%r)" % (self.name, self.type, self.damage, self.pvp_damage, self.energy, self.duration)

